import React from 'react';
import '../../../App.css';
import Footer from '../../Footer';
import Navbar from '../../Navbar';
import './Contact.css'

function Contact() {
  return (
    <>
      <Navbar/>
      <div class="bgc">
      <div class="contact" id="contact">
      <h1 class="heading">
          <span>c</span>
          <span>o</span>
          <span>n</span>
          <span>t</span>
          <span>a</span>
          <span>c</span>
          <span>t</span>
        </h1>
      </div>
      </div>
      <Footer/>
    </>
  );
}

export default Contact;
